import React from 'react';
import { Link } from 'react-router-dom';

function Navbar({ onPageChange }) {
  return (
    <nav>
      <ul>
        <li onClick={() => onPageChange('main')}>
          <Link to="/">Главная</Link>
        </li>
        <li onClick={() => onPageChange('profil')}>
          <Link to="/profil">Моя страница</Link>
        </li>
        <li onClick={() => onPageChange('myblog')}>
          <Link to="/myblog">Мой блог</Link>
        </li>
        <li onClick={() => onPageChange('blogers')}>
          <Link to="/blogers">Блогеры</Link>
        </li>
        <li>
          <Link to="/login">Войти</Link>
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
